import './Board.css';
import React from 'react';
import setBoard from './App.js';
import onClickButton from './App.js';

export function Board(props) {
  return (
    <div class="board">
        <div class="box" onClick={() => props.onClickButton(0)}>{props.val}</div>
        <div class="box" onClick={() => props.onClickButton(1)}>{props.val}</div>
        <div class="box" onClick={() => props.onClickButton(2)}>{props.val}</div>
        <div class="box" onClick={() => props.onClickButton(3)}>{props.val}</div>
        <div class="box" onClick={() => props.onClickButton(4)}>{props.val}</div>
        <div class="box" onClick={() => props.onClickButton(5)}>{props.val}</div>
        <div class="box" onClick={() => props.onClickButton(6)}>{props.val}</div>
        <div class="box" onClick={() => props.onClickButton(7)}>{props.val}</div>
        <div class="box" onClick={() => props.onClickButton(8)}>{props.val}</div>
    </div>
  );
}
